import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import {Link} from 'react-router-dom';
import './navigation.css';

const Navigation = ({ onRouteChange, text }) => {
    return (

        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <Link className="navbar-brand" to="/root" onClick={ onRouteChange }>QR App</Link>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
                <li className="nav-item active navbar-right">
                    <a className="nav-link" href="#">{text}</a>
                </li>
            </ul>
            <div className="input-group mb-3">
                <div className="input-group-prepend">
                    <span className='input-group-text'>Current Cycle</span>
                </div>
                <input type='number' name="currentCycle" onChange={this.onNumberFixed} id="currentCycle" /><br/>
                <input type='number' name="cycleNumber" onChange={this.onCycleFixed()} id="cycleNumber" /><br />
                <canvas id="myGraph"></canvas>
            </div>
        </div>
    </nav>

);

};

export default Navigation;
